import React, { useState } from 'react';
import styled from 'styled-components'
import { PageOuterWrapper, SimpleFlexPageWraper } from './PageWrapper'

const ButtonElement = styled.button`
    height: 16px;
    font-size: 20px;
    font-weight: 500
    letter-spacing: .25px;
    background-color: #eb3323;
    width: 100px;
    border-radius: 4px;
    padding: 20px  20px;
    // padding: 9px 16px 9px 16px;
    margin-left: 5px ;
    text-align: center;

`;

const Button = (props) => (
    <SimpleFlexPageWraper>
        <ButtonElement  {...props} >{props.name}</ButtonElement>
    </SimpleFlexPageWraper>
);

export { Button };
